/*Table structure for table `crm_services` */

DROP TABLE IF EXISTS `crm_services`;

CREATE TABLE `crm_services` (
  `id` int(6) NOT NULL auto_increment,
  `fid` int(6) NOT NULL,
  `pid` int(6) default '0',
  `type` varchar(10) default '01',
  `name` varchar(2000) NOT NULL,
  `dateline` date NOT NULL,
  `remindTime` date default NULL,
  `userid` varchar(20) default NULL,
  `filename` varchar(200) default NULL,
  `orgfilename` varchar(200) default NULL,
  `isdel` varchar(2) default '0',
  PRIMARY KEY  (`id`)
